import{initializeGUI as i}from"../utility/initialize-gui.js";import{userAgent as n,userDevice as t,userTimeZone as o}from"../utility/identification.js";window.handleCredentialResponse=function(e){e=e.credential;fetch("/api/api/verifyIdToken",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({idToken:e,userAgent:n,userDevice:t,userTimeZone:o})}).then(e=>e.json()).then(e=>{!0===e.loginSuccess?i():alert("An error occured on the server. We apologize for the inconvenience. Please try again later.")}).catch(e=>{})};